import React, { Component } from 'react';
import {
	HeaderWrapper,
	Logo,
	Nav
}from './style.js'

class Header extends Component {
	render() {
		return(
			<HeaderWrapper>
				<Logo/>
				<Nav>
					<NavItem>Home</NavItem>
					<NavItem>Articles</NavItem>
					<NavItem>Login</NavItem>
					<NavItem>Aa</NavItem>
				</Nav>
			</HeaderWrapper>
		) 
	}
}

export default Header;
